import React from 'react'

const Header = () => {
    return (
        <>
           <div className="header">
               <img src="https://i.pinimg.com/originals/72/f0/b7/72f0b7053a7ec860e2134d1d8131e3d1.png" alt="logo" />
               <h1 className="header-name">Ritesh Keep App</h1>
           </div> 
        </>
    )
}

export default Header
